generated_sparql:
SELECT ?point ?label WHERE {
  ?point a ?class .
  ?class rdfs:subClassOf* brick:Point .
  OPTIONAL { ?point rdfs:label ?label . }
}

PREFIX brick: <https://brickschema.org/schema/Brick#>
PREFIX brref: <https://brickschema.org/schema/Brick/ref#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?entity ?label ?externalRef WHERE {
  ?entity brref:hasExternalReference ?externalRef .
  OPTIONAL { ?entity rdfs:label ?label }
}
LIMIT 100
